import React from "react";

const ColoredBox = ({ color }) => {
  let string = color.hex;

  let bgColor = {
    backgroundColor: string,
  };

  return (
    <div className="boxas" style={bgColor}>
      {color.name}
    </div>
  );
};

export default ColoredBox;
